import React, {useState} from "react";
import {connect} from "react-redux";
import "./effector-channel.scss";
import DryWetKnob from "./DryWetKnob/DryWetKnob";
import {Dropdown, DropdownButton} from "react-bootstrap";
const Effector = props => {

    const [currentEffect, setCurrentEffect] = useState('none');


    return (
        <div className="effector-channel">
            <div className="dra-wet-knob">
                <DryWetKnob alt="D/W"/>
            </div>
            <div className="effect-selector">
                    <DropdownButton title={currentEffect} className="btn-effect-select">
                        <Dropdown.Item onClick={setCurrentEffect.bind(null, 'Reverb')}>Reverb</Dropdown.Item>
                        <Dropdown.Item onClick={setCurrentEffect.bind(null, 'Echo')}>Echo</Dropdown.Item>
                        <Dropdown.Item onClick={setCurrentEffect.bind(null, 'Delay')}>Delay</Dropdown.Item>
                    </DropdownButton>
            </div>
            <div className="effector-param">
                <DryWetKnob alt="D/W"/>
                <DryWetKnob alt="D/W"/>
                <DryWetKnob alt="D/W"/>
            </div>
        </div>
    )
}

const mapStateToProps = (state, ownProps) => ({
    effects : state.effector.effects,
})

export default connect(mapStateToProps)(Effector);
